import React, { Component } from 'react';
import {Container, Row, Col} from 'react-bootstrap'
export default class Create extends Component {
  render() {
    return (
      <div id="create">
        <Container>
          <Col>
            <h1>
              Create A Team
            </h1>
            <h2>
              What Does Creating A Team Entail?
            </h2>
            <pg1>
              Creating a team through our website is simple and straight forward. First, choose your league.
              Pathfinders Robotics supports FIRST (For the Inspiration and Recognition of Science and Technology)
              Lego League Junior (FLL Jr.), FIRST Lego League (FLL), and FIRST Tech Challenge (FTC).
            </pg1>
          </Col>
          <Col>

          </Col>
        </Container>
      </div>
    );
  }
}
